// import {useEffect, useState} from 'react'; 
import logo from '../logo.svg';
import {motion} from "framer-motion";

function Left(){
    return (
        <img src={logo} alt="Logo" className="w-40 h-10 bg-red-200"/>
    )
}

function right(){
    return (
        <div className='border'>
            <span>Home</span>
        </div>
    )
}

function Navbar(){
    return (
        <motion.div transition={{duration:1.5}} className="border p-2">
            <Left />
        </motion.div>
    )
}

export default Navbar;
